# Intended for sourcing by other shell scripts
# This file is automatically generated by fs-package

. ./PACKAGE.FS

export FSENV_PREFIX="`pwd`/build/env/_prefix"

export CMAKE_PREFIX_PATH=$FSENV_PREFIX

export C_INCLUDE_PATH=$FSENV_PREFIX/include
export CPLUS_INCLUDE_PATH=$FSENV_PREFIX/include
export LIBRARY_PATH=$FSENV_PREFIX/lib:$FSENV_PREFIX/lib64
export PKG_CONFIG_PATH=$FSENV_PREFIX/lib/pkgconfig:$FSENV_PREFIX/lib64/pkgconfig

export PATH=$FSENV_PREFIX/bin:$PATH
export LD_LIBRARY_PATH=$FSENV_PREFIX/lib:$FSENV_PREFIX/lib64

if [ "$PACKAGE_MACOS_VERSION_MIN" != "" ]; then
export MACOSX_DEPLOYMENT_TARGET=$PACKAGE_MACOS_VERSION_MIN
else
export MACOSX_DEPLOYMENT_TARGET=10.13
fi
